import React from 'react'
import axios from 'axios'

class Givenword extends React.Component {
    constructor (props){
        super(props);
        this.state = {
            word : 'testWord'
        }
    }
    componentDidMount() {
        axios.get('/')
            .then(function(response){
                this.setState({word: response})
            })
            .catch(function(error){
                console.log(error)
            })
    }

    render() {
        return (
            <h1>{this.state.word}</h1>
        )
    }
}

export default Givenword
